}*/

function App() {
  return (
    <div className='main'>
      <div className='flex'>
        <SearchBar />
        <BoxLeft id='mainBox'>
          <div>BUDAPEST</div>
          <img src={sunny} className='mainImg' />
        </BoxLeft>
        <BoxLeft />
      </div>
      <div className='flex'>

        <BoxRight />
        <BoxRight />
        <BoxRight />
        <BoxRight />
        <BoxRight />

      </div>
    </div >
  )
}

export default App;
